import './App.css';

function App() {
  return (
    <div className="App">
      <label>PersonID:</label>
      <input type="number"/>
      <label>FirstName:</label>
      <input type="text"/>
      <label>LastName:</label>
      <input type="text"/>
      <label>Age:</label>
      <input type="number"/>
      <label>Address:</label>
      <input type="text"/>
      <label>Position:</label>
      <input type="text"/>
    </div>
  );
}

export default App;
